import React from 'react';
import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';
import Home from './pages/Home';

const App = () => {
    return (
        <Router>
            <main>
                <Switch>
                    <Route exact path="/" component={Home} />  {/* Home page route */}
                </Switch>
            </main>
        </Router>
    );
};

export default App;
